import { Container } from "react-bootstrap";
import './location.css'

const LocationSearch = () => {


    return (
        <Container>
            <label for="location">Find your Own Tattoo Artist.</label>
            <div className="d-flex gap-3">
                <div className="btn-ink-first">
                    <i class="fa-solid fa-location-dot"></i>
                    <input type="search" className="reset" name="city" />
                </div>

                <button className="btn-ink-second"><i class="fa-solid fa-arrow-right"></i></button>
            </div>
        </Container>
    );
}

export default LocationSearch;
